import React from 'react'
import Form from './Form'

const AddUsers = () => {
    const formSubmitHandler = e => {
        e.preventDefault()
        console.log(e);
    }
    return (
        <Form formSubmitHandler={formSubmitHandler}/>
    )
}

export default AddUsers
